import React from 'react';

const Navbar = ({ logo, links, backgroundColor, textColor }) => {
  const navbarStyles = {
    container: {
      backgroundColor: backgroundColor || '#007bff',
      color: textColor || '#fff',
      padding: '10px 20px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
    },
    logo: {
      fontSize: '20px',
      fontWeight: 'bold',
    },
    linksContainer: {
      display: 'flex',
      listStyle: 'none',
    },
    link: {
      color: textColor || '#fff',
      textDecoration: 'none',
      marginLeft: '20px',
      fontSize: '16px',
      fontWeight: '500',
    },
  };

  return (
    <nav style={navbarStyles.container}>
      <div style={navbarStyles.logo}>
        {logo ? (
          <img src={logo} alt="Logo" style={{ height: '30px' }} />
        ) : (
          'Logo'
        )}
      </div>
      <ul style={navbarStyles.linksContainer}>
        {links.map((link, index) => (
          <li key={index}>
            <Link to={link.path} style={navbarStyles.link}>
              {link.name}
            </Link>
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default Navbar;
